import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faBars,
  faHome,
  faCircleUser,
  faHammer,
  faEnvelope,
} from "@fortawesome/free-solid-svg-icons";

export default function Header() {
  return (
    <div className="header">
      <img src="" className="header-image-left"></img>
      <div className="header-container-right">
        <button className="header-button-home">
          <FontAwesomeIcon icon={faHome} />
          Home
        </button>
        <button className="header-button-about">
          <FontAwesomeIcon icon={faCircleUser} />
          About
        </button>
        <button className="header-button-projects">Projects</button>
        <button className="header-button-contact">Contact</button>
        <button className="header-button-navigation">
          <FontAwesomeIcon icon={faBars} />
        </button>
      </div>
    </div>
  );
}
